def map_targets(Y):
    # converter para inteiros
    mapping = {}
    classes = ['Q1', 'Q2', 'Q3', 'Q4']
    for x in range(len(classes)):
        mapping[classes[x]] = x
    Y_hot_encoded = [mapping[temp] for temp in Y]
    # one hot enconding
    Y_hot_encoded = np_utils.to_categorical(Y_hot_encoded)
    return Y_hot_encoded

    


